  - table: HP_SixHour_Forecast
    collection: Study
    pipeline: [
      {"$match": {"Name": "HP_SixHour"}},
      {"$project": {"Forecasts": 1}},
      {"$unwind": "$Forecasts"},
      {"$lookup": {"from": "Forecast", "localField": "Forecasts", "foreignField": "Name", "as": "Forecast"}},
      {"$unwind": "$Forecast"},
      {"$project": {"_id": 0, "forecast": "$Forecast.ForecastName"}}
    ]
    columns:
      - Name: forecast
        MongoType: string
        SqlName: forecast
        SqlType: varchar

  - table: HP_SixHour_Class
    collection: Study
    pipeline: [
      {"$match": {"Name": "HP_SixHour"}},
      {"$project": {"Class": 1}},
      {"$lookup": {"from": "Class", "localField": "Class", "foreignField": "Name", "as": "Class"}},
      {"$unwind": "$Class"},
      {"$project": {"Location": { "$objectToArray": "$Class.Location"}}},
      {"$unwind": "$Location"},
      {"$unwind": "$Location.v.Breakpoint"},
      {"$group": {"_id": { "Name": "$Location.v.Breakpoint.Name"}}},
      {"$project": {"_id": 0, "class": "$_id.Name"}},

      {"$unionWith": {"coll": "Study", "pipeline": [
        {"$match": {"Name": "HP_SixHour"}},
        {"$project": {"Class": 1}},
        {"$lookup": {"from": "Class", "localField": "Class", "foreignField": "Name", "as": "Class"}},
        {"$unwind": "$Class"},
        {"$project": {"Breakpoint": "$Class.Breakpoint"}},
        {"$unwind": {"path": "$Breakpoint", "includeArrayIndex": "order"}},
        {"$project": {"_id": 0, "class": "$Breakpoint.Name", "operator": "$Breakpoint.Operator", "threshold": "$Breakpoint.Threshold", "order": "$order"}}
      ]}}
    ]
    columns:
      - Name: class
        MongoType: string
        SqlName: class
        SqlType: varchar
      - Name: operator
        MongoType: string
        SqlName: operator
        SqlType: varchar
      - Name: threshold
        MongoType: float64
        SqlName: threshold
        SqlType: float
      - Name: order
        MongoType: int
        SqlName: order
        SqlType: int

- db: FEWS_ARCHIVE
  tables:
  - table: HP_SixHour_Flowsheet_EventDates
    collection: ExternalForecastingScalarTimeSeries
    pipeline: [
      {"$match":
        {"$or": [
          {
            "moduleInstanceId": "Send_Final_Flowsheet",
            "parameterId": "HP",
            "qualifierId": "[\"Sim\"]",
            "encodedTimeStepId": "DTOD_0_6_12_18TZ_CST",
            "localForecastTime": {"$gte": {"$date": "2023-01-01T00:00:00Z"}, "$lt": {"$date": "2024-01-01T00:00:00Z"}}
          }
        ]}},
      {"$unwind": "$timeseries"},
      {"$group": {"_id": "$timeseries.lt"}},
      {"$project": {
        "date": {"$dateTrunc": {"date": "$_id", "unit": "day"}}
      }},
      {"$group": {
        "_id": "$date",
        }},
      {"$project":{
        "_id": 0,
        "date": "$_id",
        "day": {"$dateToString": {"date": "$_id", "format": "%Y-%m-%d"}},
        "month": {"$dateToString": {"date": "$_id", "format": "%Y-%m"}},
        "monthName": {"$dateToString": {"date": "$_id", "format": "%Y-%b"}},
